import './home.css';
import {useState, useEffect } from 'react';
const Home = () => {
    const [cata, setCata] = useState([])

    useEffect(() => {
        fetch('https://www.themealdb.com/api/json/v1/1/categories.php')
            .then(response => response.json())
            .then(json => setCata(json));
    
    }, []);
    console.log(cata)
    return (
        <div>
            {cata.map(val => {
                <h1 key={val.idCategory}>{val.strCategory}</h1>
            }
            )}
        </div>
    );
}

export default Home;
